import React from "react";
import Header from "../../Components/Header";
import Sidebar from "../../Components/sidebar";
import Card from "../../Components/UI/Cards";
import "./style.css";

const Home = (props) => {
  const galleryheight = 450;
  const gallerystyle = {
    height: galleryheight + "px",
    overflow: "hidden",
  };
  const sideimage = galleryheight / 3;
  return (
    <div>
      <Card>
        <div className="gallerypost" style={gallerystyle}>
          <section style={{ width: "70%" }}>
            <div>
              <img
                src={require("../../blogimg/space.jpg").default}
                alt="Popular Image"
              />
            </div>
          </section>
          <section className={"sideimagewrapper"} style={{ width: "30%" }}>
            <div style={{ height: `${sideimage}px` }}>
              <img
                src={require("../../blogimg/space.jpg").default}
                alt="Popular Image"
              />
            </div>

            <div style={{ height: `${sideimage}px` }}>
              <img
                src={require("../../blogimg/space.jpg").default}
                alt="Popular Image"
              />
            </div>

            <div style={{ height: `${sideimage}px` }}>
              <img
                src={require("../../blogimg/space.jpg").default}
                alt="Popular Image"
              />
            </div>
          </section>
        </div>
      </Card>

      <section className="Homec">
        <div style={{ width: "70%" }}>
          <Card style={{ marginBottom: "20px" }}>
            <div className="postimagewrapper">
              <img
                src={require("../../blogimg/space.jpg").default}
                alt="Popular Image"
              />
            </div>
            <div style={{textAlign:'center'}}>
                <span>Featured</span>
                <h2>Fitness Mantra to live fit life</h2>
                <span>posted on 22 Jan 2021</span>
            </div>
          </Card>

          <Card style={{ marginBottom: "20px" }}>Post 2</Card>
        </div>
        <Sidebar />
      </section>
    </div>
  );
};

export default Home;
